	"Please Mister Postman": ['With The Beatles', 1963, 120.0, 'John', 'Paul・George', '325・6122・Höfner', 'https://beatlesdata.info/2/07_pleasemisterpostman.html', 'zni6ap7hDGI', 'JUbhuTcU6yM', '6wfK1R6FoLpmUA9lk5ll4T', "Wait, oh yes wait a minute mister postman<br>Wait, wait mister postman<br><br>Mister postman look and see<br>Is there a letter in your bag for me<br>I been waiting a long long time<br>Since I heard from that girl of mine<br><br>There must be some word today<br>From my girlfriend so far away<br>Please Mister postman look and see<br>If there's a letter, a letter for me<br>I been standing here waiting Mister postman<br>So patiently<br>For just a card or just a letter<br>Saying she's returning home to me<br><br>Mister postman look and see<br>Is there a letter in your bag for me<br>I been waiting a long long time<br>Since I heard from that girl of mine<br><br>So many days you passed me by<br>See the tear standing in my eye<br>You didn't stop to make me feel better<br>By leaving me a card or a letter<br><br>So Mister postman look and see<br>Is there a letter in your bag for me<br>I been waiting a long long time<br>Since I heard from that girlfriend of mine<br><br>You gotta wait a minute, wait a minute<br>You gotta wait a minute, wait a minute<br>You gotta wait a minute, wait a minute<br>You gotta check it and see, one more time for me<br>You gotta wait a minute, wait a minute<br>You gotta wait a minute, wait a minute<br>You gotta wait a minute, wait a minute<br>Deliver the letter, the sooner the better<br>You gotta wait a minute, wait a minute<br>You gotta wait a minute, wait a minute<br>You gotta wait a minute, wait a minute"],
	"Roll Over Beethoven": ['With The Beatles', 1963, 161.0, 'George', '', '325・6122・Höfner', 'https://beatlesdata.info/2/08_rolloverbeethoven.html', '', 'TqqEtEje0-g', '3idqWaBn3mRdsIodCU6uBi', "Well gonna write a little letter<br>Gonna mail it to my local D.J.<br>It's a rocking little record<br>I want my jockey to play<br>Roll over Beethoven<br>Gotta hear it again today<br><br>You know my temperature's rising<br>And the jukebox blows a fuse<br>My heart beating rhythm<br>While my soul keeps singing the blues<br>Roll over Beethoven<br>And tell Tchaikovsky the news<br><br>I got a rocking pneumonia<br>I need a shot of rhythm and blues<br>I think I caught it off the writer<br>Sittin' down by the rhythm reviews<br>Roll over Beethoven<br>We're rockin' in two by two<br><br>Well if you feel it and like it<br>Well get your lover and reel and rock it<br>Roll it over and move on up<br>Just triffle further and reel and rock it<br>Roll it over<br>Roll over Beethoven<br>A rocking in two by two - Ooo<br><br>Well early in the morning<br>I'm a giving you the warning<br>Don't you step on my blue suede shoes<br>Hey diddle diddle<br>I'll play my fiddle<br>Ain't got nothing to lose<br>Roll over Beethoven<br>And tell Tchaikovsky the news<br><br>You know she wiggles like a glow worm<br>Dance like a spinning top<br>She's got a crazy partner<br>Oughta see them reel an rock<br>Long as she's got a dime<br>The music will never stop<br>Roll over Beethoven<br>Roll over Beethoven<br>Roll over Beethoven<br>Roll over Beethoven<br>Roll over Beethoven<br>Dig to these rhythm and blues"],
