	"Strawberry Fields Forever": ['Magical Mystery Tour', 1967, 0.0, 'John', 'Paul', '', 'https://beatlesdata.info/9/08_strawberryfieldsforever.html', '', '', '3Am0IbOxmvlSXro7N5iSfZ', 'Let me take you down, \'cause I\'m going to Strawberry Fields<br>Nothing is real and nothing to get hung about<br>Strawberry Fields forever<br><br>Living is easy with eyes closed<br>Misunderstanding all you see<br>It\'s getting hard to be someone but it all works out<br>It doesn\'t matter much to me<br>Let me take you down, cause I\'m going to Strawberry Fields<br>Nothing is real and nothing to get hung about<br>Strawberry Fields forever<br><br>No one I think is in my tree<br>I mean it must be high or low<br>That is you can\'t you know tune in but it\'s all right<br>That is I think it\'s not too bad<br>Let me take you down, cause I\'m going to Strawberry Fields<br>Nothing is real and nothing to get hung about<br>Strawberry Fields forever<br><br>Always know, sometimes think it\'s me<br>But you know, I know when it\'s a dream<br>I think a "No," I mean a "Yes"<br>But it\'s all wrong<br>That is, I think I disagree<br><br>Let me take you down, cause I\'m going to Strawberry Fields<br>Nothing is real and nothing to get hung about<br>Strawberry Fields forever<br>Strawberry Fields forever<br>Strawberry Fields forever'],
	"Penny Lane": ['Magical Mystery Tour', 1967, 113.0, 'Paul', 'John・George', '', 'https://beatlesdata.info/9/09_pennylane.html', 'Sj4tcbX5tbg', 'Iz3J6rdQ8kA', '1h04XMpzGzmAudoI6VHBgA', "In Penny Lane there is a barber showing photographs<br>Of every head he's had the pleasure to have known<br>And all the people that come and go<br>Stop and say hello<br><br>On the corner is a banker with a motorcar<br>The little children laugh at him behind his back<br>And the banker never wears a mac<br>In the pouring rain, very strange<br><br>Penny Lane is in my ears and in my eyes<br>There beneath the blue suburban skies<br>I sit, and meanwhile back<br><br>In Penny Lane there is a fireman with an hourglass<br>And in his pocket is a portrait of the queen<br>He likes to keep his fire engine clean<br>It's a clean machine<br><br>Penny Lane is in my ears and in my eyes<br>A four of fish and finger pies<br>In summer, meanwhile back<br><br>Behind the shelter in the middle of a roundabout<br>The pretty nurse is selling poppies from a tray<br>And though she feels as if she's in a play<br>She is anyway<br><br>In Penny Lane the barber shaves another customer<br>We see the banker sitting waiting for a trim<br>And then the fireman rushes in<br>From the pouring rain, very strange<br><br>Penny Lane is in my ears and in my eyes<br>There beneath the blue suburban skies<br>I sit, and meanwhile back<br>Penny Lane is in my ears and in my eyes<br>There beneath the blue suburban skies<br>Penny Lane"],
