	"Sexy Sadie": ['The Beatles', 1968, 76.0, 'John', 'Paul・George', '', 'https://beatlesdata.info/11/05_sexysadie.html', '', 'GFSK14VuMyI', '2tBv9tAdqEbLNDi5smSjbg', "Sexy Sadie what have you done<br>You made a fool of everyone<br>You made a fool of everyone<br>Sexy Sadie ooh what have you done<br><br>Sexy Sadie you broke the rules<br>You layed it down for all to see<br>You layed it down for all to see<br>Sexy Sadie oooh you broke the rules<br><br>One sunny day the world was waiting for a lover<br>She came along to turn on everyone<br>Sexy Sadie the greatest of them all<br><br>Sexy Sadie how did you know<br>The world was waiting just for you<br>The world was waiting just for you<br>Sexy Sadie oooh how did you know<br><br>Sexy Sadie you'll get yours yet<br>However big you think you are<br>However big you think you are<br>Sexy Sadie oooh you'll get yours yet<br><br>We gave her everything we owned just to sit at her table<br>Just a smile would lighten everything<br>Sexy Sadie she's the latest and the greatest of them all<br><br>She made a fool of everyone<br>Sexy Sadie<br><br>However big you think you are<br>Sexy Sadie"],
