	"Long, Long, Long": ['The Beatles', 1968, 84.0, 'George', 'Paul', '', 'https://beatlesdata.info/11/07_longlonglong.html', '', '', '40d2EcaOOCUjDzzo2YvUWn', "It's been a long long long time<br>How could I ever have lost you<br>When I loved you<br><br>It took a long long long time<br>Now I'm so happy I found you<br>How I love you<br><br>So many tears I was searching<br>So many tears I was wasting, oh oh<br><br>Now I can see you, be you<br>How can I ever misplace you<br>How I want you<br>Oh I love you<br>You know that I need you<br>Ooh I love you<br><br>Oh"],
	"Revolution 1": ['The Beatles', 1968, 100.0, 'John', 'Paul・George', '', 'https://beatlesdata.info/11/08_revolution1.html', '', '', '1aOzDhi5a1RWWRy5dmYA8I', "Ah, take 2<br>OK!<br><br>You say you want a revolution<br>Well you know<br>We all want to change the world<br>You tell me that it's evolution<br>Well you know<br>We all want to change the world<br><br>But when you talk about destruction<br>Don't you know that you can count me out in<br><br>Don't you know it's gonna be alright<br>Don't you know it's gonna be alright<br>Don't you know it's gonna be alright<br><br>You say you got a real solution<br>Well you know<br>We'd all love to see the plan<br>You ask me for a contribution<br>Well you know<br>We're doing what we can<br><br>But if you want money for people with minds that hate<br>All I can tell you is brother you have to wait<br><br>Don't you know it's gonna be alright<br>Don't you know it's gonna be alright<br>Don't you know it's gonna be alright<br><br>You say you'll change the constitution<br>Well you know<br>We'd all love to change your head<br>You tell me it's the institution<br>Well you know<br>You better free your mind instead<br><br>But if you go carrying pictures of Chairman Mao<br>You ain't going to make it with anyone anyhow<br><br>Don't you know it's gonna be alright<br>Don't you know it's gonna be alright<br>Don't you know it's gonna be alright<br><br>Oh, oh, oh, oh, oh, oh, oh, oh, oh, oh<br>Alright, alright, alright, alright, alright<br>Alright, alright, alright, alright, alright<br>Oh, oh, oh, oh, oh, oh<br>Alright, alright, alright<br>Alright<br>Alright"],
	"Honey Pie": ['The Beatles', 1968, 143.0, 'Paul', '', '', 'https://beatlesdata.info/11/09_honeypie.html', '', '', '1TPcNcmuKlq0PKpYOBgP1U', "She was a working girl<br>North of England way<br>Now she's hit the big time<br>In the USA<br>And if she could only hear me<br>This is what I'd say<br><br>Honey pie you are making me crazy<br>I'm in love but I'm lazy<br>So won't you please come home<br><br>Oh honey pie my position is tragic<br>Come and show me the magic<br>Of your Hollywood song<br><br>You became a legend of the silver screen<br>And now the thought of meeting you<br>Makes me weak in the knee<br><br>Oh honey pie you are driving me frantic<br>Sail across the Atlantic<br>To be where you belong<br><br>Honey pie come back to me, oh<br><br>Yeah<br>I like it like that, oh ah<br>I like this kind of hot kind of music<br>Hot kind of music<br>Play it to me, play it to me, honey, the blues<br><br>Will the wind that blew her boat<br>Across the sea<br>Kindly send her sailing back to me<br><br>Honey pie you are making me crazy<br>I'm in love but I'm lazy<br>So won't you please come home<br>Come, come back to me, honey pie<br><br>Oooooooooooh oh<br>Oh oh oh oh oh oh oh<br>Honey pie, honey pie"],
	"Savoy Truffle": ['The Beatles', 1968, 120.0, 'George', 'Paul', '', 'https://beatlesdata.info/11/10_savoytruffle.html', '', 'ptDYUhYx24I', '5iyCSUM7zzficwaGo8GIoc', "Creme tangerine and montelimar<br>A ginger sling with a pineapple heart<br>A coffee dessert, yes, you know it's good news<br>But you'll have to have them all pulled out<br>After the Savoy truffle<br><br>Cool cherry cream, nice apple tart<br>I feel your taste all the time we're apart<br>Coconut fudge really blows down those blues<br>But you'll have to have them all pulled out<br>After the Savoy truffle<br><br>You might not feel it now<br>But when the pain cuts through<br>You're going to know and how<br>The sweat is going to fill your head<br>When it becomes too much<br>You'll shout aloud<br><br>[Instrumental/Solo]<br><br>But you'll have to have them all pulled out<br>After the Savoy truffle<br><br>You know that what you eat you are<br>But what is sweet now turns so sour<br>We all know obla-dibla-da<br>But can you show me where you are?<br><br>Creme tangerine and montelimar<br>A ginger sling with a pineapple heart<br>A coffee dessert, yes, you know it's good news<br>But you'll have to have them all pulled out<br>After the Savoy truffle<br><br>Yes you'll have to have them all pulled out<br>After the Savoy truffle"],
	"Cry Baby Cry": ['The Beatles', 1968, 76.0, 'John', 'Paul', '', 'https://beatlesdata.info/11/11_crybabycry.html', '', 'To-3wbRmW2k', '5XmetMMUFNXClbiYnGdVmP', "Cry baby cry<br>Make your mother sigh<br>She's old enough to know better<br><br>The king of Marigold was in the kitchen<br>Cooking breakfast for the queen<br>The queen was in the parlour<br>Playing piano for the children of the king<br><br>Cry baby cry<br>Make your mother sigh<br>She's old enough to know better<br>So cry baby cry<br><br>The king was in the garden<br>Picking flowers for a friend who came to play<br>The queen was in the playroom<br>Painting pictures for the childrens holiday<br><br>Cry baby cry<br>Make your mother sigh<br>She's old enough to know better<br>So cry baby cry<br><br>The duchess of Kircaldy always smiling<br>And arriving late for tea<br>The duke was having problems<br>With a message at the local bird and bee<br><br>Cry baby cry<br>Make your mother sigh<br>She's old enough to know better<br>So cry baby cry<br><br>At twelve o'clock a meeting round the table<br>For a seance in the dark<br>With voices out of nowhere<br>Put on specially by the children for a lark<br><br>Cry baby cry<br>Make your mother sigh<br>She's old enough to know better<br>So cry baby cry cry cry cry baby<br>Make your mother sigh<br>She's old enough to know better<br>Cry baby cry<br><br>Cry cry cry<br>Make your mother sigh<br>She's old enough to know better<br>So cry baby cry"],
