	"I've Got A Feeling": ['Let It Be', 1970, 82.0, 'John・Paul', '', 'Casino・Telecaster・Höfner・エレピ', 'https://beatlesdata.info/14/08_ivegotafeeling.html', '', 'c9_LBjmHBlc', '3gwRWIbr5ycEVLIAXrWaw7', "I've got a feeling, a feeling deep inside<br>Oh yeah, oh yeah, that's right<br>I've got a feeling, a feeling I can't hide<br>No no no, oh no, oh no<br>Yeah yeah I've got a feeling yeah<br><br>Oh please believe me, I'd hate to miss the train<br>Oh yeah, yeah, oh yeah<br>And if you leave me I won't be late again<br>Oh no, oh no, oh no<br>Yeah yeah I've got a feeling yeah<br>I've got a feeling<br><br>All these years I've been wandering around<br>Wondering how come nobody told me<br>All that I was looking for was somebody<br>Who looked like you<br><br>I've got a feeling, that keeps me on my toes<br>Oh yeah, oh yeah<br><br>I've got a feeling, I think that everybody knows<br>Oh yeah, oh yeah, oh yeah<br>Yeah yeah I've got a feeling yeah<br>Yeah<br><br>Everybody had a hard year<br>Everybody had a good time<br>Everybody had a wet dream<br>Everybody saw the sunshine<br>Oh yeah, (oh yeah) oh yeah, oh yeah<br>Everybody had a good year<br>Everybody let their hair down<br>Everybody pulled their socks up<br>Everybody put their foot down<br>Oh yeah<br>Yeah I've got a feeling<br>A feeling deep inside<br>Oh yeah<br><br>Oh yeah<br><br>I've got a feeling<br>A feeling I can't hide<br>Oh no<br><br>Oh no no no<br><br>Yeah yeah yeah yeah<br>I've got a feeling<br><br>I've got a feeling<br><br>Everybody had a good year<br>Everybody had a hard time<br><br>Everybody had a wet dream<br><br>Everybody saw the sunshine<br><br>Everybody had a good year<br>Everybody let their hair down<br><br>Everybody pulled their socks up<br><br>Everybody put the foot down<br>Oh yeah<br><br>Oh yeah<br><br>I've got a feeling<br>Yeah yeah yeah yeah<br><br>[Oh my soul, so hard.]"],
	"One After 909": ['Let It Be', 1970, 188.0, 'John・Paul', '', '', 'https://beatlesdata.info/14/09_oneafter909.html', 'FURUWms-7jU', 'UM8vgJi8Rl0', '50qHmeex1nPTyQTwBXjSE4', "My baby says she's trav'ling on the one after 909<br>I said move over honey I'm travelling on that line<br>I said move over once, move over twice<br>Come on baby don't be cold as ice<br>I said I'm trav'ling on the one after 909<br><br>I begged her not to go and I begged her on my bended knees<br>You're only fooling around, you're fooling around with me<br>I said move over once, move over twice<br>Come on baby don't be cold as ice<br>I said I'm trav'ling on the one after 909<br><br>I got my bag, run to the station<br>Railman says you've got the the wrong location<br>I got my bag, run right home<br>Then I find I've got the number wrong<br><br>Well I said I'm trav'ling on the one after 909<br>I said move over honey I'm travelling on that line<br>I said move over once, move over twice<br>Come on baby don't be cold as ice<br>I said I'm trav'ling on the one after 909<br><br>I got my bag, run to the station<br>railman says you've got the the wrong location<br>I got my bag, run right home<br>Then I find I've got the number wrong<br><br>Well I said I'm trav'ling on the one after 909<br>I said move over honey I'm travelling on that line<br>I said move over once, move over twice<br>Come on baby don't be cold as ice<br>I said we're trav'ling on the one after 90<br>I said we're trav'ling on the one after 90<br>I said we're trav'ling on the one after 909<br><br>[Oh Danny Boy, the old summer is calling.]"],
	"The Long And Winding Road": ['Let It Be', 1970, 66.0, 'Paul', '', '', 'https://beatlesdata.info/14/10_thelongandwindingroad.html', '', 'cqDUO8JqLQU', '6p6E3pMc9moSp5kV3BLN0y', "The long and winding road, that leads, to your door<br>Will never disappear, I've seen that road before<br>It always leads me here, lead me to your door<br>The wild and windy night, that the rain, washed away<br>Has left a pool of tears, crying for the day<br>Why leave me standing here, let me know the way<br><br>Many times I've been alone, and many times I've cried<br>Any way you'll never know, the many ways I've tried<br>And still they lead me back, to the long winding road<br>You left me standing here a long long time ago<br>Don't leave me waiting here, lead me to your door<br><br>But still they lead me back to the long winding road<br>You left me standing here, a long long time ago<br>Don't keep me waiting here (Don't keep me waiting), lead me to your door<br>Yeah, yeah, yeah, yeah"],
	"For You Blue": ['Let It Be', 1970, 0.0, 'George', '', '', 'https://beatlesdata.info/14/11_foryoublue.html', '', '', '5dpRJkvY8oWMQmQbEQTXhO', "Because you're sweet and lovely girl I love you<br>Because you're sweet and lovely girl it's true<br>I love you more than ever girl I do<br>I want you in the morning girl I love you<br>I want you at the moment I feel blue<br>I'm living every moment girl for you<br><br>(Walk, walk cat walk.<br>Go, Johnny, go.<br>Same old the twelve bar blues.<br><br>Elmore James got nothing on this baby.)<br><br>I've loved you from the moment I saw you<br>You looked at me that's all you had to do<br>I feel it now I hope you feel it too<br><br>Because you're sweet and lovely girl I love you<br>Because you're sweet and lovely girl it's true<br>I love you more than ever girl I do<br>Rhythm and blues"],
	"Get Back": ['Let It Be', 1970, 123.0, 'Paul', 'John', 'Casino・Telecaster・Höfner・エレピ', 'https://beatlesdata.info/14/12_getback.html', 'SAU_KGcSXNY', 'TOohRK5Y_S0', '5V8Ma6MQwoBf7Z7Lq2w26s', "Jo Jo was a man who thought he was a loner<br>But he knew it couldn't last<br>Jo Jo left his home in Tucson, Arizona<br>For some California grass<br><br>Get back, get back<br>Get back to where you once belonged<br>Get back, get back<br>Get back to where you once belonged<br>Get back Jo Jo<br>Go home<br><br>Get back, get back<br>Get back to where you once belonged<br>Get back, get back<br>Back to where you once belonged<br>Get back, Jo<br><br>Sweet Loretta Martin thought she was a woman<br>But she was another man<br>All the girls around her say she's got it coming<br>But she gets it while she can<br><br>Oh, get back, get back<br>Get back to where you once belonged<br>Get back, get back<br>Get back to where you once belonged<br>Get back, Loretta<br><br>Go home<br>Oh, get back, get back<br>Get back to where you once belonged<br>Get back, get back<br>Get back to where you once belonged<br><br>Ooh, ooh, get back, Loretta<br>Your mommy's waiting for you<br>Wearing her high-heel shoes<br>And her low-neck sweater<br>Get back home, Loretta<br><br>Get back, get back, get back to where you once belonged<br>Oh, get back, get back<br>Get back, oh, yes<br>Jo Jo"],
	"From Me To You": ['Past Masters', 1963, 136.0, 'John・Paul', '', '', 'https://beatlesdata.info/15/02_frommetoyou.html', 'k43ZBsBfBW8', 'GtWM_3CryKA', '7nBGBbzfnPiowCvXKJnV9J', "Da da da da da dum dum da<br>Da da da da da dum dum da<br><br>If there's anything that you want<br>If there's anything I can do<br>Just call on me and I'll send it along<br>With love from me to you<br><br>I've got everything that you want<br>Like a heart that's oh so true<br>Just call on me and I'll send it along<br>With love from me to you<br><br>I got arms that long to hold you<br>And keep you by my side<br>I got lips that long to kiss you<br>And keep you satisfied, oooh<br><br>If there's anything that you want<br>If there's anything I can do<br>Just call on me and I'll send it along<br>With love from me to you<br><br>From me, to you<br>Just call on me and I'll send it along<br>With love from me to you<br><br>I got arms that long to hold you<br>And keep you by my side<br>I got lips that long to kiss you<br>And keep you satisfied, oooh<br><br>If there's anything that you want<br>If there's anything I can do<br>Just call on me and I'll send it along<br>With love from me to you<br>To you, to you, to you"],
