	"Long Tall Sally": ['Past Masters', 1965, 172.0, 'Paul', '', '325・Duo Jet・Höfner・Piano', 'https://beatlesdata.info/15/10_longtallsally.html', 'vK97gJVinxg', '5ykVPa3FwvA', '7ds98B8y5BQltzC60Gdkri', "I'm gonna tell Aunt Mary 'bout Uncle John<br>He said he had the misery but he got a lot of fun<br>Baby, yeah now baby<br>Woo baby, some fun tonight<br><br>I saw Uncle John with Long Tall Sally<br>He saw Aunt Mary coming and he ducked back in the alley<br>Oh, baby, yeah now baby<br>Woo baby, some fun tonight<br><br>Well Long Tall Sally's built pretty sweet<br>She got everything that Uncle John need<br>Baby, yeah now baby<br>Woo baby, some fun tonight<br><br>Well, we're gonna have some fun tonight<br>Have some fun tonight<br>Everything's all right<br>Have some fun tonight<br>Have some fun<br>Yeah, yeah, yeah,<br>We're gonna have some fun tonight<br>Have some fun tonight<br>Everything's all right<br>Have some fun tonight<br>Yeah, we'll have some fun<br>Some fun tonight"],
