	"I'm Down": ['Past Masters', 1965, 90.0, 'Paul', 'John・George', '', 'https://beatlesdata.info/15/18_imdown.html', 'vBzRg5CSEzE', 'XZavjTPjkpI', '5ovYFa8Em47SgPmhBlZb5N', 'You telling lies thinking I can\'t see<br>You don\'t cry cos you\'re laughing at me<br>I\'m down (I\'m really down)<br>I\'m down (Down on the ground)<br>I\'m down (I\'m really down)<br>How can you laugh when you know I\'m down<br>(How can you laugh) When you know I\'m down<br><br>Man buys ring woman throws it away<br>Same old thing happens everyday<br>I\'m down (I\'m really down)<br>I\'m down (Down on the ground)<br>I\'m down (I\'m really down)<br>How can you laugh when you know I\'m down<br>(How can you laugh) When you know I\'m down<br><br>We\'re all alone and there\'s nobody else<br>You still moan, "Keep your hands to yourself!"<br>I\'m down (I\'m really down)<br>Oh baby I\'m down (Down on the ground)<br>I\'m down (I\'m really down)<br>How can you laugh when you know I\'m down<br>(How can you laugh) When you know I\'m down.<br>Waaaao! Baby I\'m down<br><br>Oh baby you know I\'m down (I\'m really down)<br>Oh yes I\'m down (I\'m really down)<br>I\'m down on the ground (I\'m really down)<br>Ahhhh! Down (I\'m really down)<br>Oh baby I\'m upside down, a yea yea yea yea yea<br>I\'m down (I\'m really down)<br>Oh baby I\'m down (I\'m really down)<br>I\'m feeling upside down (I\'m really down)<br>Ooo! I\'m down (I\'m really down)<br>Baby I\'m down yea<br>Oh baby I\'m down yea<br>Baby I\'m down (I\'m really down)<br>Well baby I\'m down (I\'m really down)<br>Well baby baby baby (I\'m really down)<br>Oh baby I\'m down<br>I\'m down, down, down'],
	"Day Tripper": ['Past Masters', 1965, 137.0, 'Paul・John', 'George', 'J-160E・6119・6122・ Höfner・タンバリン', 'https://beatlesdata.info/16/01_daytripper.html', '1PL_VttcEo0', 'M7Xd4-SypGk', '7qbRP2jO0Sq3kTYdEW1v00', "Got a good reason for taking the easy way out<br>Got a good reason for taking the easy way out now<br>She was a day tripper, one way ticket yeah<br>It took me so long to find out, and I found out<br><br>She's a big teaser, she took me half the way there<br>She's a big teaser, she took me half the way there now<br>She was a day tripper, one way ticket yeah<br>It took me so long to find out, and I found out<br><br>Tried to please her, she only played one night stands<br>Tried to please her, she only played one night stands now<br>She was a day tripper, Sunday driver yeah<br>It took me so long to find out, and I found out<br><br>Day tripper<br>Day tripper yeah<br>Day tripper<br>Day tripper yeah<br>Day tripper"],
	"We Can Work It Out": ['Past Masters', 1965, 106.0, 'Paul', 'John', 'J-160E・Höfner・タンバリン、ハーモニウム', 'https://beatlesdata.info/16/02_wecanworkitout.html', 'ufbXcCAc22M', 'FhM0qubH92E', '7tBAxQ6hD4mhr1sYQhwWDP', "Try to see it my way<br>Do I have to keep on talking till I can't go on?<br>While you see it your way<br>Run the risk of knowing that our love may soon be gone<br><br>We can work it out<br>We can work it out<br><br>Think of what you're saying<br>You can get it wrong and still you think that it's alright<br>Think of what I'm saying<br>We can work it out and get it straight, or say goodnight<br><br>We can work it out<br>We can work it out<br><br>Life is very short, and there's no time<br>For fussing and fighting, my friend<br>I have always thought that it's a crime<br>So I will ask you once again<br><br>Try to see it my way<br>Only time will tell if I am right or I am wrong<br>While you see it your way,<br>There's a chance that we might fall apart before too long<br><br>We can work it out<br>We can work it out<br><br>Life is very short, and there's no time<br>For fussing and fighting, my friend<br>I have always thought that it's a crime<br>So I will ask you once again<br><br>Try to see it my way<br>Only time will tell if I am right or I am wrong<br>While you see it your way<br>There's a chance that we might fall apart before too long<br><br>We can work it out<br>We can work it out"],
	"Paperback Writer": ['Past Masters', 1966, 80.0, 'Paul', 'John・George', '6120・SG・4001', 'https://beatlesdata.info/16/03_paperbackwriter.html', 'HTI-jqdsqQk', 'IXeB37SVw9w', '4401c08DdNwwGEg8WGCkQf', "Paperback writer<br><br>Dear Sir or Madam, will you read my book?<br>It took me years to write, will you take a look?<br>It's based on a novel by a man named Lear<br>And I need a job, so I want to be a paperback writer<br>Paperback writer<br><br>It's the dirty story of a dirty man<br>And his clinging wife doesn't understand<br>His son is working for the Daily Mail<br>It's a steady job but he wants to be a paperback writer<br>Paperback writer<br><br>Paperback writer<br><br>It's a thousand pages, give or take a few<br>I'll be writing more in a week or two<br>I can make it longer if you like the style<br>I can change it round and I want to be a paperback writer<br>Paperback writer<br><br>If you really like it you can have the rights<br>It could make a million for you overnight<br>If you must return it, you can send it here<br>But I need a break and I want to be a paperback writer<br>Paperback writer<br><br>Paperback writer<br><br>Paperback writer, paperback writer<br>Paperback writer, paperback writer<br>Paperback writer, paperback writer<br>Paperback writer, paperback writer (fade out)"],
