	"Lady Madonna": ['Past Masters', 1968, 110.0, 'Paul', 'John・George', '', 'https://beatlesdata.info/16/05_ladymadonna.html', 'XulnGuWAO5U', 'YNKAVxlZqPM', '1tM9TBNPjieSOZ2d5VAQ1y', "Lady Madonna, children at your feet<br>Wonder how you manage to make ends meet<br>Who finds the money when you pay the rent<br>Did you think that money was Heaven sent?<br>Friday night arrives without a suitcase<br>Sunday morning creeping like a nun<br>Monday's child has learned to tie his bootlace<br>See how they run<br><br>Lady Madonna, baby at your breast<br>Wonders how you manage to feed the rest?<br><br>See how they run<br><br>Lady Madonna lying on the bed<br>Listen to the music playing in your head<br><br>Tuesday afternoon is never ending<br>Wednesday morning papers didn't come<br>Thursday night your stockings needed mending<br>See how they run<br><br>Lady Madonna, children at your feet<br>Wonder how you manage to make ends meet"],
